import React from 'react';
import './Home.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>CourseForge</h1>
        <p>
          Hello we welcome you to CourseForge.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <div className="main-content">
      <div className="logo-container">
        <h1 className="gradient-text">Course Forge</h1>
        <div className="tools-icon"></div> {/* Placeholder for the tools icon */}
      </div>
    </div>
      </header>
    </div>
  );
}

export default App;
